import * as React from "react";
import  {Routes, Route, Link}  from "react-router-dom";
import "./App.css";
import Portfolio from "./views/portfolio";

const papp =() =>{
  return (
    <div className="App">
      <h1>Welcome to React Router!</h1>
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="about" element={<About />} />
      </Routes>
    </div>
  );
}
export default papp;
